              <td>
                <input type="text" placeholder="pratham" />
              </td>
              <td></td>
            </tr>
            <tr>
              <td>
                <input type="email" placeholder="pratham@gmail.com" />
              </td>
              <td></td>
            </tr>
            <tr>
              <td></td>
              <td></td>
            </tr>
          </tbody>
